import "../styles/App.css";
import { GetDataFromApi } from "../service/GetDataFromApi";

function App() {
  const [data, setData] = useState([]);
  return (
    <div className="App">
      <ul>
        {data.map((card) => (
          <li key={card.id}>
            <img src={card.image} alt={card.name} />
            {card.name} <GetIcon species={card.species} />
            {card.status}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
